import React from 'react';
import '../index.css';
import podcastImage from '../assets/podcast.png'; // Adjust the path as necessary

const Projects = () => {
    return (
        <section className="projects" id='projects'>
            <h2>ПРОЕКТЫ</h2>
            <section className="project-zone">
                <div className="carousel-project">
                    <img src={podcastImage} alt="Podcast Zone" />
                    <div className="carousel-controls">
                        <button className="prev"><i className="fi fi-br-angle-left"></i></button>
                        <button className="next"><i className="fi fi-bs-angle-right"></i></button>
                    </div>
                    <div className="carousel-caption-project">
                        <div className="caption-text">
                            <h3>AITU Podcast</h3>
                            <p>Университетский проект студентов, направленный на медиа развитие университета в сфере подкастинга и YouTube контент-мейкинга</p>
                        </div>
                        <a href="https://www.instagram.com/mediastudio.kz?igsh=c2VmNGgwOTIzeWx2" className="project-book">Смотреть</a>
                    </div>
                </div>
            </section>
        </section>
    );
};

export default Projects;
